import Repository, { apiUrl } from './Repository';

class AuthRepository {
    constructor(callback) {
        this.callback = callback;
    }

    async getExamMainCategory() {
        const reponse = await Repository.get(`${apiUrl}/exammaincategory/master`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    
    async getHomeExamMasterCategory(id) {
        const reponse = await Repository.get(`${apiUrl}/exammaincategory/category/${id}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getExamSubCategoryById(id) {
        const reponse = await Repository.get(`${apiUrl}/exammaincategory/main/${id}`)
        .then(response => {
            return response.data;
        })
        .catch(error => ({ error: JSON.stringify(error) }));
    return reponse;
}
async getExammainCategoryById(id) {
    const reponse = await Repository.get(`${apiUrl}/exammaincategory//sub/${id}`)
    .then(response => {
        return response.data;
    })
    .catch(error => ({ error: JSON.stringify(error) }));
return reponse;
}
}

export default new AuthRepository();
